import React from 'react';
import client from '../util/shopify-client'



const myProduct = () => {
    client.product.fetchAll().then((products) => {
        products.map((item,i) => {
            return(
                <div>
                    {item.title}
                </div>
            )
        })
    })

}


const Store = () => {
    return(
        <div>
            <myProduct />
        </div>
    )
}

export default Store;
